import { Component, Inject, OnInit } from '@angular/core';
import { FormGroup, ValidationErrors, FormControl, Validators } from '@angular/forms';
import { MAT_DIALOG_DATA, MatDialogRef } from '@angular/material/dialog';
import { Store, select } from '@ngrx/store';
import { Observable } from 'rxjs';
import { AddMemberModalComponent } from '../../members/add-member-modal/add-member-modal.component';
import { editAccount } from '../../resources/state/general.actions';
import { selectErrors } from '../../resources/state/general.selector';
import { AccountModel } from '../../resources/models/account-model';
import { AppState } from '../../../../store';

@Component({
  selector: 'app-edit-account-modal',
  templateUrl: './edit-account-modal.component.html',
  styleUrls: ['./edit-account-modal.component.scss']
})
export class EditAccountModalComponent implements OnInit {
  accountForm!: FormGroup;
  serverErrors$: Observable<ValidationErrors | null>;

  constructor(public dialogRef: MatDialogRef<AddMemberModalComponent>,
    private store: Store<AppState>,
    @Inject(MAT_DIALOG_DATA) public data: AccountModel) {
    this.serverErrors$ = this.store.pipe(select(selectErrors));
  }

  ngOnInit(): void {
    this.accountForm = new FormGroup({
      title: new FormControl(this.data.title, [Validators.required, Validators.minLength(2), Validators.maxLength(75)]),
      currency: new FormControl(this.data.currency, [Validators.required]),
    });
    this.selectedImage = this.data.icon;
  }

  onSubmit() {
    this.accountForm!.markAllAsTouched();
    if (!this.accountForm.valid || this.selectedImage === undefined) return;

    const result: AccountModel = {
      id: this.data.id,
      title: this.accountForm.controls['title'].value,
      currency: this.data.currency,
      icon: this.selectedImage!
    };

    this.store.dispatch(editAccount({ account: result }));
  }

  getFormControl(controlName: string) {
    return this.accountForm?.get(controlName) as FormControl;
  }

  icons: string[] = [
    'data:image/svg+xml;base64,',
    'data:image/svg+xml;base64,',
    'data:image/svg+xml;base64,',
    'data:image/svg+xml;base64,',
    'data:image/svg+xml;base64,',
    'data:image/svg+xml;base64,',
    'data:image/svg+xml;base64,',
    'data:image/svg+xml;base64,',
    'data:image/svg+xml;base64,',
    'data:image/svg+xml;base64,',
  ]

  selectedImage?: string | null;

  selectImage(image: string) {
    this.selectedImage = image;
  }

}
